import React, { useEffect } from 'react';
import './MarsInfo.css';
import logo from './path-to-your-logo.png'; // Update path
import avatar from './path-to-avatar.png'; // Update path

const MarsInfo = () => {
    // Navigation handlers
    const goHome = (e) => {
        e.preventDefault();
        // Add your navigation logic here
    };

    const goToListing = () => {
        // Add your navigation logic here
    };

    // Add 3D hover effect
    useEffect(() => {
        const productImage = document.querySelector('.productImage');

        const handleMouseMove = (e) => {
            const { left, top, width, height } = productImage.getBoundingClientRect();
            const x = (e.clientX - left) / width;
            const y = (e.clientY - top) / height;

            productImage.style.transform = `
                perspective(1000px)
                rotateY(${(x - 0.5) * 20}deg)
                rotateX(${(y - 0.5) * -20}deg)
            `;
        };

        const handleMouseLeave = () => {
            productImage.style.transform = 'none';
        };

        productImage.addEventListener('mousemove', handleMouseMove);
        productImage.addEventListener('mouseleave', handleMouseLeave);

        return () => {
            productImage.removeEventListener('mousemove', handleMouseMove);
            productImage.removeEventListener('mouseleave', handleMouseLeave);
        };
    }, []);

    return (
        <div className="marsInfo">
            <div className="stars"></div>
            <div className="stars"></div>
            <div className="stars"></div>

            <nav className="navbar">
                <a href="/" className="logoContainer" onClick={goHome}>
                    <img src={logo} alt="AlienExpress Logo" className="logoImg" />
                    <span className="logoText">AlienExpress - Galactic Hub</span>
                </a>
                <div className="navLinks">
                    <a href="index.html">Desktop App</a>
                    <a href="Map.js">Place Selection</a>
                    <a href="listing.html">Resource Shop</a>
                </div>
            </nav>

            <div className="breadcrumb">
                <a href="listing.html">Galactic Hub</a>
                <span></span>
                <a href="marsinfo.html">Mars Resources</a>
                <span></span>
                Mars Bucketed Water 
            </div>

            <div className="productContainer">
                <div className="leftColumn">
                    <div className="productImage">
                        <img 
                            src="https://cdn.glitch.global/6cecf6a3-d527-4bf1-b4c3-e4900e777fdb/OIP%20(1).jpg" 
                            alt="Mars Bucketed Water" 
                            className="productPhoto"
                        />
                    </div>
                    <div className="sourceInfo">
                        <div className="sourceIndicator"></div>
                        <div>
                            Sourced from (red indicators): <br />
                            Drag the model around!
                        </div>
                        <iframe src="mars.html" title="Mars Source Locations"></iframe>
                    </div>
                </div>

                <div className="productInfo">
                    <div>
                        <h1 className="productTitle">Mars Bucket o' Water</h1>
                        <p className="productPrice">50.00 cows 🐄</p>
                        <small className="warningText">
                            ⚠️ Basic filtration only & prone to spillage - Industrial use recommended
                        </small>
                    </div>

                    <div className="productStatus">
                        <i className="fas fa-shield-alt statusIcon"></i>
                        <div>
                            <div>Protected by Intergalactic Trade Federation</div>
                            <small className="opacity70">
                                All transactions secured by quantum encryption
                            </small>
                        </div>
                    </div>

                    <button className="btn btnPrimary">Purchase Now</button>

                    <div className="productDetails">
                        <p>• Extracted from Mars polar ice caps</p>
                        <p>• Basic filtration applied</p>
                        <p>• Contains mineral deposits</p>
                        <p>• High iron content - rusty color</p>
                        <p>• Not recommended for consumption</p>
                        <p>• Suitable for: </p>
                        <ul>
                            <li>Industrial cooling</li>
                            <li>Terraforming projects</li>
                            <li>Chemical processing</li>
                            <li>Construction work</li>
                        </ul>
                    </div>

                    <div className="tags">
                        <span className="tag">#MarsWater</span>
                        <span className="tag">#IronOxidized!</span>
                        <span className="tag">#MarsBars</span>
                    </div>

                    <div className="merchantInfo">
                        <div className="merchantAvatar">
                            <img src={avatar} alt="Merchant Avatar" />
                        </div>
                        <div>
                            <div>Red Planet Resources Ltd</div>
                            <small className="opacity70">
                                Basic Resource Extractor - Class C License
                            </small>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default MarsInfo;
